const OrganizationCard = ({ organization }) => {
  const openVolunteerPage = () => {
    window.open(organization.volunteerPage, '_blank');
  };

  return (
    <div className="organization-card">
      <img src={organization.image} alt={organization.name} />
      <div className="organization-card-content">
        <h2>{organization.name}</h2>
        <p>{organization.description}</p>
        <button onClick={openVolunteerPage}>
          Volunteer Now
        </button>
      </div>
    </div>
  );
};

function Organizations() {
  const [selectedTopic, setSelectedTopic] = useState('all');

  const filterOrganizations = (topic) => {
    setSelectedTopic(topic);
  };

  const filteredOrganizations = selectedTopic === 'all' ? organizations : organizations.filter(org => org.topic === selectedTopic);

  return (
    <div className="App">
      <div className="left-side">
      {/* <h1>Volunteer Opportunities</h1> */}

      <div className="filter-box">
        <h2>Filter by Topic:</h2>
        <button

          className="climate"
          onClick={() => filterOrganizations('all')}
        >
          All
        </button>
        <button
          className={selectedTopic === 'Loss of Biodiversity' ? 'active' : ''}
          onClick={() => filterOrganizations('Loss of Biodiversity')}
        >
          Loss of Biodiversity
        </button>
        <button
          className="climate"
          onClick={() => filterOrganizations('Climate')}
        >
          Climate
        </button>
        <button
          className={selectedTopic === 'Waste Management' ? 'active' : ''}
          onClick={() => filterOrganizations('Waste Management')}
        >
          Waste Management
        </button>
        <button
          className="climate"
          onClick={() => filterOrganizations('Reforestation')}
        >
          Reforestation
        </button>
        <button
          className="climate"
          onClick={() => filterOrganizations('Water Pollution')}
        >
          Water Pollution
        </button>
        <button
          className="climate"
          onClick={() => filterOrganizations('Other')}
        >
          Other
        </button>
      </div>
      </div>

      <div className="organization-list">
        {filteredOrganizations.map((org, index) => (
          <OrganizationCard key={index} organization={org} />
        ))}
      </div>
    </div>
  );
}

export default Organizations;
